// Filename - Header.js

import * as React from "react";


export default function Header() {
    return (
        <header >
        <nav >
          <h1 >My Website</h1>
          <ul >
            <li href="/">Home</li>
            <li href="/about">About</li>
            <li href="/contact">Contact</li>
          </ul>
        </nav>
      </header>
    );
}
